  url: "https://via.placeholder.com/600/56a8c2",
  thumbnailUrl: "https://via.placeholder.com/150/56a8c2"
  },
];



const App = () => {
  return (
    <BrowserRouter>
        <div className="out">
          {data.map((v)=>(<div key={v.title}>
              <div className="element">
                <Link to= "/">{v.title} / {v.id}</Link>
              </div>
              <img src={v.thumbnailUrl} alt="사진" />
          </div>
          )) }
        </div>
        <Switch>
          <Route path = "/"></Route>
        </Switch>
        </BrowserRouter>
  );
}

export default App;
